import { useState } from "react";
import Login from '../Login'

const [statusLogin, setStatusLogin] = useState(false)
const handleLogin = () => {
    setStatusLogin(true)
}


function Modal() {
    return (
        <>
            <button onClick={handleLogin}>Đăng kí </button>
            {(statusLogin) &&
                <div>
                    <button>Close</button>
                    <div>
                        <Login />
                    </div>
                </div>}

        </>
    )
}

export default Modal
